class HTMLSidebarElement extends HTMLElement{constructor(){super();const e=this.attachShadow({mode:"open"}),t=document.createElement("style");t.textContent="\n          :host {\n            position: fixed;\n            top: 0;\n            left: -240px;\n            width: 240px;\n            height: 100%;\n            background: white;\n            transition: left 0.3s ease;\n            box-shadow: 0 0 10px rgba(0, 0, 0, 0.2);\n            display: block;\n          }\n\n          :host([open]), :host([partial][open]) {\n            left: 0;\n          }\n\n          :host([partial]){\n            left: -160px;\n          }\n        ",e.appendChild(t),e.appendChild(document.createElement("slot"))}open(){this.setAttribute("open","")}close(){this.removeAttribute("open")}toggle(){this.hasAttribute("open")?this.close():this.open()}}customElements.define("html-sidebar",HTMLSidebarElement);